const tables=document.querySelectorAll(".typo table"),images=document.querySelectorAll(".typo img"),iframes=document.querySelectorAll(".typo iframe");export function typo(){if(tables.length)for(const e of tables){const o=document.createElement("div");o.style.overflowX="auto",e.parentNode.insertBefore(o,e),o.appendChild(e)}if(images.length)for(const e of images)e.loading="lazy";if(iframes.length)for(const e of iframes)e.loading="lazy"}